  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sand Lake
  NWR, Pocasse NWR, and Sand Lake WMD outlines Refuge accomplishments during the 1992
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses management planning, public participation, compliance with environmental
  and cultural resource mandates, and research and investigations. Refuge administration
  is outlined; information about personnel, volunteer programs, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands, forests,
  croplands, grasslands, grazing, haying, fire management, pest control, and water
  rights. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, wildlife propagation, scientific collections,
  animal control, marking and bird banding, and disease control. The public uses of
  the Refuge described in this report include outdoor classrooms, interpretive programs,
  hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, computer systems, and energy conservation. Cooperative programs and items
  of interest are provided at the end. Refuge brochures are attached.\",\n\t\"owner_org\":
